function App() {

  const [sidebar,setSidebar]=useState(true);

  return (
    <div>
        <Navbar/>

        <Routes>
          <Route path='/' element={<Home/>} />
          <Route path='/video/:categoryId/:videoId' element={<Video/>} />
        </Routes>
    </div>
  );
}

export default App;
